import React, { useState, useEffect } from 'react';
import './App.css';

const SYMBOL_EMOJI = {
  'A': '1',
  'B': '⭐',
  'C': '💎',
  'D': '◇',
};

function App() {
  const [balance, setBalance] = useState(457.00);
  const [betPerLine, setBetPerLine] = useState(5.40);
  const [lastWin, setLastWin] = useState(0.00);
  const [grid, setGrid] = useState(Array(3).fill(Array(3).fill('◇')));
  const [isSpinning, setIsSpinning] = useState(false);
  const [lines, setLines] = useState(10);

  useEffect(() => {
    fetchBalance();
  }, []);

  const fetchBalance = async () => {
    try {
      const response = await fetch('http://localhost:8080/api/balance');
      const data = await response.json();
      setBalance(data.balance);
    } catch (error) {
      console.error('Error fetching balance:', error);
    }
  };

  const handleSpin = async () => {
    if (isSpinning) return;
    setIsSpinning(true);
    setLastWin(0);

    try {
      const response = await fetch('http://localhost:8080/api/spin', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ amount: Math.floor(betPerLine) }),
      });

      if (!response.ok) {
        throw new Error('Spin failed');
      }

      const data = await response.json();
      setGrid(data.grid.map(row => row.map(symbol => SYMBOL_EMOJI[symbol])));
      setBalance(data.balance);
      setLastWin(data.winnings);
      setIsSpinning(false);

    } catch (error) {
      setIsSpinning(false);
      alert('Error occurred while spinning');
    }
  };

  const handleBetChange = (amount) => {
    const newBet = Math.max(0.10, Math.min(100, betPerLine + amount));
    setBetPerLine(Number(newBet.toFixed(2)));
  };

  const handleLinesChange = (value) => {
    setLines(Math.max(1, Math.min(10, value)));
  };

  return (
    <div className="App">
      <div className="slot-machine">
        <div className="title-bar">GOLDEN VEGAS SLOTS</div>

        <div className="slot-grid">
          {grid.map((row, i) => (
            row.map((symbol, j) => (
              <div 
                key={`${i}-${j}`} 
                className={`symbol ${isSpinning ? 'spinning' : ''}`}
              >
                {symbol}
              </div>
            ))
          ))}
        </div>

        <div className="controls">
          <div className="bet-section">
            <div className="lines-control">
              <label>LINES</label>
              <input 
                type="range"
                min="1"
                max="10"
                value={lines}
                onChange={(e) => handleLinesChange(parseInt(e.target.value))}
                className="line-slider"
              />
              <span className="lines-value">{lines}</span>
            </div>

            <div className="bet-control">
              <label>BET PER LINE</label>
              <div className="bet-adjuster">
                <button onClick={() => handleBetChange(-0.10)}>-</button>
                <span>${betPerLine.toFixed(2)}</span>
                <button onClick={() => handleBetChange(0.10)}>+</button>
              </div>
            </div>
          </div>

          <button 
            className="spin-button"
            onClick={handleSpin}
            disabled={isSpinning}
          >
            SPIN
          </button>

          <div className="stats-section">
            <div className="stat">
              <label>LAST WIN</label>
              <span>${lastWin.toFixed(2)}</span>
            </div>
            <div className="stat">
              <label>BALANCE</label>
              <span>${balance.toFixed(2)}</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
